import React from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  ScrollView,
  SafeAreaView,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { globalStyles } from '../styles/globalStyles';

interface DrawerItem {
  id: number;
  title: string;
  icon: string;
  color: string;
}

interface CustomDrawerProps {
  onClose: () => void;
  onLogout: () => void;
}

const CustomDrawer: React.FC<CustomDrawerProps> = ({ onClose, onLogout }) => {
  const menuItems: DrawerItem[] = [
    {
      id: 1,
      title: 'Add Complaint',
      icon: 'call-outline',
      color: '#3498db',
    },
    {
      id: 2,
      title: 'Material Requisition',
      icon: 'add-circle-outline',
      color: '#9b59b6',
    },
    {
      id: 3,
      title: 'Leave',
      icon: 'umbrella-outline',
      color: '#e67e22',
    },
    {
      id: 4,
      title: 'Travelling',
      icon: 'airplane-outline',
      color: '#1abc9c',
    },
    {
      id: 5,
      title: 'Add Customer',
      icon: 'person-add-outline',
      color: '#e74c3c',
    },
    {
      id: 6,
      title: 'Create AMC',
      icon: 'calendar-outline',
      color: '#f39c12',
    },
    {
      id: 7,
      title: 'View Attendance',
      icon: 'pie-chart-outline',
      color: '#2ecc71',
    },
  ];

  const handleMenuPress = (item: DrawerItem): void => {
    console.log(`Pressed: ${item.title}`);
    onClose(); // Close drawer after selection
  };

  return (
    <SafeAreaView style={globalStyles.drawerContainer}>
      {/* Header Section */}
      <View style={globalStyles.drawerHeader}>
        <View style={globalStyles.drawerUserInfo}>
          <Ionicons name="person-outline" size={24} color="#fff" />
          <Text style={globalStyles.drawerUserName}>soundahr</Text>
        </View>
        <View style={globalStyles.drawerPhoneInfo}>
          <Ionicons name="call-outline" size={16} color="#fff" />
          <Text style={globalStyles.drawerPhoneNumber}>*******4821</Text>
        </View>
      </View>

      {/* Menu Items */}
      <ScrollView style={globalStyles.drawerMenuContainer} showsVerticalScrollIndicator={false}>
        {menuItems.map((item) => (
          <TouchableOpacity
            key={item.id}
            style={globalStyles.drawerMenuItem}
            onPress={() => handleMenuPress(item)}
          >
            <View style={globalStyles.drawerMenuItemLeft}>
              <View style={[globalStyles.drawerIconContainer, { backgroundColor: item.color }]}>
                <Ionicons name={item.icon} size={20} color="#fff" />
              </View>
              <Text style={globalStyles.drawerMenuText}>{item.title}</Text>
            </View>
            <Ionicons name="chevron-forward" size={16} color="#bdc3c7" />
          </TouchableOpacity>
        ))}

        {/* Logout Item */}
        <TouchableOpacity style={globalStyles.drawerMenuItem} onPress={onLogout}>
          <View style={globalStyles.drawerMenuItemLeft}>
            <View style={[globalStyles.drawerIconContainer, { backgroundColor: '#e74c3c' }]}>
              <Ionicons name="log-out-outline" size={20} color="#fff" />
            </View>
            <Text style={globalStyles.drawerMenuText}>Logout</Text>
          </View>
          <Ionicons name="chevron-forward" size={16} color="#bdc3c7" />
        </TouchableOpacity>

        {/* Separator */}
        <View style={globalStyles.drawerSeparator} />

        {/* App Tips */}
        <View style={globalStyles.drawerAppTipsContainer}>
          <View style={globalStyles.drawerAppTipsHeader}>
            <Ionicons name="bulb-outline" size={20} color="#f39c12" />
            <Text style={globalStyles.drawerAppTipsText}>App Tips</Text>
          </View>
        </View>

        {/* Developer Info */}
        <View style={globalStyles.drawerDeveloperInfo}>
          <Text style={globalStyles.drawerDeveloperText}>Designed & Developed By</Text>
          <Text style={globalStyles.drawerCompanyName}>Lionsol Infoway Pvt. Ltd.</Text>
          <Text style={globalStyles.drawerWebsite}>https://lionsol.in</Text>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f8f9fa',
  },
  header: {
    backgroundColor: '#3498db',
    paddingTop: 20,
    paddingBottom: 30,
    paddingHorizontal: 20,
  },
  userInfo: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 10,
  },
  userName: {
    color: '#fff',
    fontSize: 18,
    fontWeight: 'bold',
    marginLeft: 12,
  },
  phoneInfo: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  phoneNumber: {
    color: '#fff',
    fontSize: 14,
    marginLeft: 8,
  },
  menuContainer: {
    flex: 1,
    paddingTop: 20,
  },
  menuItem: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-between',
    paddingVertical: 16,
    paddingHorizontal: 20,
    borderBottomWidth: 1,
    borderBottomColor: '#ecf0f1',
  },
  menuItemLeft: {
    flexDirection: 'row',
    alignItems: 'center',
    flex: 1,
  },
  iconContainer: {
    width: 36,
    height: 36,
    borderRadius: 18,
    justifyContent: 'center',
    alignItems: 'center',
    marginRight: 16,
  },
  menuText: {
    fontSize: 16,
    color: '#2c3e50',
    fontWeight: '500',
  },
  separator: {
    height: 1,
    backgroundColor: '#bdc3c7',
    marginVertical: 20,
    marginHorizontal: 20,
  },
  appTipsContainer: {
    paddingHorizontal: 20,
    marginBottom: 20,
  },
  appTipsHeader: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  appTipsText: {
    fontSize: 16,
    color: '#2c3e50',
    fontWeight: '600',
    marginLeft: 12,
  },
  developerInfo: {
    paddingHorizontal: 20,
    paddingBottom: 30,
    alignItems: 'flex-end',
  },
  developerText: {
    fontSize: 12,
    color: '#7f8c8d',
    marginBottom: 4,
  },
  companyName: {
    fontSize: 14,
    color: '#3498db',
    fontWeight: '600',
    marginBottom: 2,
  },
  website: {
    fontSize: 12,
    color: '#3498db',
  },
});

export default CustomDrawer;
